<template>
  <div class="booknew">
    <li v-for="(i,index) in books" class="booknew-sin">
      <div class="book-title">XXXpdf</div>
      <div class="book-time">{{i.time}}</div>
      <img :src="i.img1">
      <div class="book-small">{{i.small}}</div>
      <div class="book-detail">
        <!--<img :src="i.img2">-->
        <!--<embed src="../common/other/context.pdf"></embed>-->
        <iframe :src="srcs"></iframe>
         
      </div>
      <div class="book-bottom">
        <span class="bottom-check" @click="checkall">{{dosome}}</span>
        <span class="bottom-rel" @click="releases">{{release}}</span>
      </div>
    </li>
  </div>
</template>

<script type="text/ecmascript-6">
  export default{
    data(){
      return {
        dosome: '查看全文',
        release: '发布',
        srcs: 'qqq.pdf',
        books: [{
          'time': '6月28日',
          'pic': '',
          'small': '书名：百年孤独  作者：加夫列尔·加西亚 马尔克斯 馆藏地：图书阅览室 索引号15947',
          'img1': 'data:image/png;base64,',
          'img2': 'data:image/png;base64,'
        }]
      }
    },
    created(){
      document.body.style.backgroundColor = 'rgba(7,17,27,0.1)'
    },
    methods: {
      checkall(){
        if (this.dosome === '查看全文') {
          document.getElementsByClassName('book-detail')[0].style.display = 'block'
          this.dosome = '收起↑'
          document.getElementsByClassName('booknew-sin')[0].style.height = 'auto'
        } else {
          document.getElementsByClassName('book-detail')[0].style.display = 'none'
          this.dosome = '查看全文'
        }
      },
      releases(){
        if (this.release === '发布') {
          this.$message({
            type: 'success',
            message: '发布成功！',
            duration: 1000
          })
          this.release = '已发布'
        } else {
          this.$message({
            type: 'info',
            message: '不得再次发布！',
            duration: 1000
          })
        }
      }
    }
  }
</script>

